import React, { Component } from 'react';
import './App.css';
import NavBar from './NavBar';
import CoursesList from './CourseList';

class App extends Component {
  render() {
    return (
      <div>
        <NavBar />
        <CoursesList />
      </div>
    );
  }
}

export default App;
